import React from 'react';

const Contact = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <div>
      <h4>Để lại tin nhắn cho chúng tôi </h4>
      <div class="mb-3">

  <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="Địa chỉ mail"/>
</div>
<div class="mb-3">
  <label for="exampleFormControlTextarea1" class="form-label">Example textarea</label>
  <textarea class="form-control" id="exampleFormControlTextarea1" rows="3" placeholder="Lời nhắn"></textarea>
</div>
      </div>
    </div>
  );
};

export default Contact;
